import logo from './logo.svg';
import './App.css';

function App() {






  return (
    <div className="App">
      <header className="App-header">
        Sunrise Avenue Solar Energy Production Forecast!
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          AI Venture Project
        </p>
      </header>
    </div>
  );
}

export default App;
